import React, { useState, useEffect, useCallback } from 'react';
import axios from '../utils/axios';
import Card from '../components/Card';
import { useNotification } from '../context/NotificationContext';

const AdminPage = () => {
  const { showNotification } = useNotification();
  const [users, setUsers] = useState([]);
  const [featureFlags, setFeatureFlags] = useState([]);
  const [loading, setLoading] = useState(true);

  const fetchAdminData = useCallback(async () => {
    setLoading(true);
    try {
      const [usersRes, featuresRes] = await Promise.all([
        axios.get('/admin/users'),
        axios.get('/admin/features'),
      ]);
      setUsers(usersRes.data);
      setFeatureFlags(featuresRes.data);
    } catch (err) {
      console.error(err);
      showNotification('Failed to fetch admin data.', 'error');
    } finally {
      setLoading(false);
    }
  }, [showNotification]);

  useEffect(() => {
    fetchAdminData();
  }, [fetchAdminData]);

  const handleSuspendToggle = async (id) => {
    try {
      await axios.put(`/admin/users/${id}/suspend`, {});
      showNotification('User suspension status updated successfully!', 'success');
      fetchAdminData();
    } catch (err) {
      console.error(err);
      showNotification('Failed to toggle user suspension.', 'error');
    }
  };

  const handleFeatureToggle = async (id, isEnabled) => {
    try {
      await axios.put(`/admin/features/${id}`, { isEnabled: !isEnabled });
      showNotification('Feature flag updated successfully!', 'success');
      fetchAdminData();
    } catch (err) {
      console.error(err);
      showNotification('Failed to toggle feature flag.', 'error');
    }
  };

  if (loading) {
    return <div className="text-center py-8">Loading admin data...</div>;
  }

  return (
    <div className="py-6">
      <h1 className="text-3xl font-bold text-gray-800 mb-6">Admin Dashboard</h1>

      <Card className="mb-8">
        <h2 className="text-lg font-medium text-gray-900 mb-4">User Management</h2>
        <div className="overflow-x-auto">
          <table className="min-w-full divide-y divide-gray-200">
            <thead className="bg-gray-50">
              <tr>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Username</th>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Email</th>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Role</th>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Status</th>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Actions</th>
              </tr>
            </thead>
            <tbody className="bg-white divide-y divide-gray-200">
              {users.length > 0 ? (
                users.map((user) => (
                  <tr key={user._id}>
                    <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">{user.username}</td>
                    <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">{user.email}</td>
                    <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">{user.role}</td>
                    <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">{user.isSuspended ? 'Suspended' : 'Active'}</td>
                    <td className="px-6 py-4 whitespace-nowrap text-right text-sm font-medium">
                      <button
                        onClick={() => handleSuspendToggle(user._id)}
                        className={`px-3 py-1 rounded text-white ${user.isSuspended ? 'bg-green-500 hover:bg-green-600' : 'bg-red-500 hover:bg-red-600'}`}>
                        {user.isSuspended ? 'Activate' : 'Suspend'}
                      </button>
                    </td>
                  </tr>
                ))
              ) : (
                <tr>
                  <td colSpan="5" className="px-6 py-4 text-center text-gray-500">No users found.</td>
                </tr>
              )}
            </tbody>
          </table>
        </div>
      </Card>

      <Card>
        <h2 className="text-lg font-medium text-gray-900 mb-4">Feature Flags</h2>
        <div className="overflow-x-auto">
          <table className="min-w-full divide-y divide-gray-200">
            <thead className="bg-gray-50">
              <tr>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Feature Name</th>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Status</th>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Actions</th>
              </tr>
            </thead>
            <tbody className="bg-white divide-y divide-gray-200">
              {featureFlags.length > 0 ? (
                featureFlags.map((feature) => (
                  <tr key={feature._id}>
                    <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">{feature.name}</td>
                    <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">{feature.isEnabled ? 'Enabled' : 'Disabled'}</td>
                    <td className="px-6 py-4 whitespace-nowrap text-right text-sm font-medium">
                      <button
                        onClick={() => handleFeatureToggle(feature._id, feature.isEnabled)}
                        className={`px-3 py-1 rounded text-white ${feature.isEnabled ? 'bg-yellow-500 hover:bg-yellow-600' : 'bg-green-500 hover:bg-green-600'}`}>
                        {feature.isEnabled ? 'Disable' : 'Enable'}
                      </button>
                    </td>
                  </tr>
                ))
              ) : (
                <tr>
                  <td colSpan="3" className="px-6 py-4 text-center text-gray-500">No feature flags found.</td>
                </tr>
              )}
            </tbody>
          </table>
        </div>
      </Card>
    </div>
  );
};

export default AdminPage;
